import React from 'react';

class Contact extends React.Component {
    constructor(props){
        super(props);
    }

    render(){
        return(
            <div>
                <img width="100%" src="assets/contactus.jpg" alt="ContactUS"/>
                <div className="container">
                    <div className="row mt-2">
                    <h3> ContactUs</h3>
                    </div>
                </div>
            </div>
        );
    }
}

export default Contact;
